import React, { Component } from "react";
import MessagesList from "./MessagesList";
import ComposeMessage from "./ComposeMessage"

class Feed extends Component {
  render() {
    return (
      <React.Fragment>
         <ComposeMessage />
        <h1 style={{ textAlign: "center", color: "green" }}>Feed</h1>
        <MessagesList />
      </React.Fragment>
    );
  }
}

export default Feed;
